INSERT INTO `psprdpar` VALUES ('4F000001','Package deals','A set of japanese food','','f4c27c96-78d5-439e-9b63-6728ae2623d1.jpg','4F','R','JP','N','N','A','2025-07-01 09:19:22','N',0,0,40.99,'N',0.00,'2025-07-01 09:19:22','',0.0,0,'yzh','yzh','2025-07-01 09:19:22','2025-07-01 09:19:22'),('4F000002','Sashimi Set','A set of sashimi','','f6288273-7527-4dc9-9a02-97ee50f76b06.jpg','4F','R','JP','N','N','A','2025-07-01 09:20:02','N',0,0,30.99,'N',0.00,'2025-07-01 09:20:02','',0.0,0,'yzh','yzh','2025-07-01 09:20:02','2025-07-01 09:20:02'),('4F000003','Omu rice','A rice serve with omu egg','','5f0e886d-7c99-456f-a143-b1380fa2755d.jpg','4F','R','JP','N','N','A','2025-07-01 09:20:48','N',0,0,13.99,'N',0.00,'2025-07-01 09:20:48','',0.0,0,'yzh','yzh','2025-07-01 09:20:48','2025-07-01 09:20:48'),('4F000004','Oden','Oden set','','43a3c47b-e7c6-4ce3-b0f5-74e87dfa3699.jpg','4F','R','JP','N','N','A','2025-07-01 09:25:19','N',0,0,20.99,'N',0.00,'2025-07-01 09:25:19','',0.0,0,'yzh','yzh','2025-07-01 09:25:19','2025-07-01 09:25:19'),('4F000005','Tonkatsu Ramen','a famous noodle soup with a rich, creamy, opaque broth made by simmering pork bones for many hours. Served with thin noodles, chashu (braised pork), soft-boiled egg, and other toppings, it\'s known for its deep umami flavor and velvety texture.','','29eefd00-a135-4da9-822a-53839855ebb5.jpg','4F','N','JP','N','N','A','2025-07-01 09:26:35','N',0,0,15.99,'N',0.00,'2025-07-01 09:26:35','',0.0,0,'yzh','yzh','2025-07-01 09:26:35','2025-07-01 09:26:35'),('4F000006','Cute Bento','Bento set','','27a6b763-fe49-4527-a76e-b5c47af0c0d1.jpg','4F','R','JP','N','N','A','2025-07-01 09:27:11','N',0,0,10.99,'N',0.00,'2025-07-01 09:27:11','',0.0,0,'yzh','yzh','2025-07-01 09:27:11','2025-07-01 09:27:11'),('4F000007','Donburi','Donburi (丼) is a classic Japanese \"rice bowl\" dish. It features a large bowl of steamed rice topped with various savory ingredients like meat, fish, or vegetables, often simmered in a dashi-based sauce, creating a complete and comforting meal.','','2495ac7d-e848-4c81-a6d8-aad2aad91e18.jpg','4F','R','JP','N','N','A','2025-07-01 09:28:13','N',0,0,20.99,'N',0.00,'2025-07-01 09:28:13','',0.0,0,'yzh','yzh','2025-07-01 09:28:13','2025-07-01 09:28:13'),('JW000001','Fillet O Fish','The Fillet-O-Fish is a classic fish sandwich: a steamed bun holding a breaded, fried fish patty (usually Alaskan pollock), tartar sauce, and a half slice of American cheese. It\'s known for its soft texture and tangy flavor.','','8c28ea69-6780-4e04-9ca1-fb1d50c99591.jpg','JW','T','WS','N','N','A','2025-07-01 10:40:36','N',0,0,18.88,'N',0.00,'2025-07-01 10:40:36','',0.0,0,'yzh','yzh','2025-07-01 10:40:36','2025-07-01 10:40:36'),('JW000002','Pasta','Pasta is a staple Italian food, typically made from unleavened dough of durum wheat flour mixed with water or eggs, and formed into various shapes. It\'s usually boiled and served with sauces, making it a versatile and globally popular dish.','','c43b69e2-3c5d-4a61-a92c-6abad1e1e575.jpg','JW','N','WS','N','N','A','2025-07-01 10:41:14','N',0,0,17.99,'N',0.00,'2025-07-01 10:41:14','',0.0,0,'yzh','yzh','2025-07-01 10:41:14','2025-07-01 10:41:14'),('JW000003','Grilled Chicken','Grilled chicken is chicken cooked over direct heat, often on a grill grate, resulting in a smoky flavor and tender, juicy meat with distinct char marks. It\'s a versatile dish, seasoned in countless ways, from simple salt and pepper to complex marinades.','','da30729e-436f-45b6-9c59-6ebdb4cf18c9.jpg','JW','T','WS','N','N','A','2025-07-01 10:41:58','N',0,0,17.99,'N',0.00,'2025-07-01 10:41:58','',0.0,0,'yzh','yzh','2025-07-01 10:41:58','2025-07-01 10:41:58'),('JW000004','Grill Steak',' cut of beef cooked over direct heat, often a grill, until it develops a flavorful crust and desired internal doneness. It\'s prized for its smoky char, tender texture, and rich, savory taste, commonly seasoned simply with salt and pepper.','','cbd39f56-ea29-4ef8-b4b9-42c8cd9f7eb7.jpg','JW','T','WS','N','N','A','2025-07-01 10:42:52','N',0,0,25.99,'N',0.00,'2025-07-01 10:42:52','',0.0,0,'yzh','yzh','2025-07-01 10:42:52','2025-07-01 10:42:52'),('JW000005','Burger Couple','Two Burger served together','','3efdc2fe-a47a-4aef-9a64-6b7e4ce34a5b.jpg','JW','B','WS','N','N','A','2025-07-01 10:43:31','N',0,0,25.88,'N',0.00,'2025-07-01 10:43:31','',0.0,0,'yzh','yzh','2025-07-01 10:43:31','2025-07-01 10:43:31'),('JW000006','Sirloin Steak','Sirloin steak is a popular cut of beef from the cow\'s hindquarters, known for its good balance of flavor and tenderness. It\'s versatile, often grilled or pan-seared to various doneness levels, and offers a robust, meaty taste without excessive marbling.','','57441f21-933c-4372-a205-f835296aa315.jpg','JW','R','WS','N','N','A','2025-07-01 10:44:40','N',0,0,35.99,'N',0.00,'2025-07-01 10:44:40','',0.0,0,'yzh','yzh','2025-07-01 10:44:40','2025-07-01 10:44:40'),('JW000007','Teppanyaki Steak',', flat iron griddle (teppan), often with a theatrical chef performance. The \"Western\" influence means it typically focuses on beef cuts with simpler seasonings, served with sides like rice or pasta, and sauces like black pepper or mushroom','','e96a3bb9-f737-4276-b0aa-52bc4a490b9d.jpg','JW','R','WS','N','N','A','2025-07-01 10:47:21','N',0,0,26.99,'N',0.00,'2025-07-01 10:47:21','',0.0,0,'yzh','yzh','2025-07-01 10:47:21','2025-07-01 10:47:21'),('KR000001','Bimbimbap','Bibimbap is a vibrant Korean dish: warm rice topped with sautéed vegetables (namul), gochujang (chili paste), kimchi, often beef or tofu, and typically a fried egg. It\'s mixed just before eating.','','cd5d648f-d09a-4a8b-b723-d78e642e5a6f.jpg','KR','N','KR','N','N','A','2025-07-01 09:08:29','N',0,0,20.90,'N',0.00,'2025-07-01 09:08:29','',0.0,0,'yzh','yzh','2025-07-01 09:08:29','2025-07-01 09:08:29'),('KR000002','JaJang Men','Jajangmyeon is a Korean-Chinese noodle dish topped with a thick, savory black bean sauce made from chunjang, diced pork (or other meat), and vegetables like onions. It\'s rich, comforting, and meant to be mixed thoroughly before eating.','','0ca619b9-b5a0-45b3-9eb2-7ec98a552483.jpg','KR','N','KR','N','N','A','2025-07-01 09:10:02','N',0,0,12.99,'N',0.00,'2025-07-01 09:10:02','',0.0,0,'yzh','yzh','2025-07-01 09:10:02','2025-07-01 09:10:02'),('KR000003','TTeobokki','Tteokbokki is a popular Korean street food: chewy rice cakes (tteok) simmered in a spicy, sweet gochujang-based sauce, often with fish cakes (eomuk). It\'s a beloved spicy-sweet comfort dish.','','680da8bc-a969-4055-8dfe-002caced0f0a.jpg','KR','R','KR','N','N','A','2025-07-01 09:11:19','N',0,0,15.99,'N',0.00,'2025-07-01 09:11:19','',0.0,0,'yzh','yzh','2025-07-01 09:11:19','2025-07-01 09:11:19'),('KR000004','KR Fried Chicken','Korean Fried Chicken (KFC) is famous for its ultra-crispy, thin, crackly crust, achieved through a double-frying process. It\'s often tossed in various flavorful sauces like spicy gochujang, soy garlic, or honey butter.','','4401851f-8600-428f-89a6-d32f9b2b2c30.jpg','KR','R','KR','N','N','A','2025-07-01 09:12:13','N',0,0,16.99,'N',0.00,'2025-07-01 09:12:13','',0.0,0,'yzh','yzh','2025-07-01 09:12:13','2025-07-01 09:12:13'),('KR000005','KimChi ramyeon','Kimchi ramyeon is a popular Korean comfort food: instant noodles (ramyeon) cooked in a savory, spicy broth flavored primarily with kimchi, often with added ingredients like egg or green onions.','','d0aa2f10-653f-4b17-9615-aa85557c2756.jpg','KR','N','KR','N','N','A','2025-07-01 09:14:05','N',0,0,11.99,'N',0.00,'2025-07-01 09:14:05','',0.0,0,'yzh','yzh','2025-07-01 09:14:05','2025-07-01 09:14:05'),('KR000006','Gimbap','Gimbap is a popular Korean dish of seasoned rice and various fillings (like vegetables, egg, meat, or pickled radish) tightly rolled in dried seaweed (gim) and sliced into bite-sized pieces. It\'s a colorful, portable, and versatile meal.','','320b3431-a9d1-4b2b-a23a-1123195350f4.jpg','KR','T','KR','N','N','A','2025-07-01 09:14:56','N',0,0,5.99,'N',0.00,'2025-07-01 09:14:56','',0.0,0,'yzh','yzh','2025-07-01 09:14:56','2025-07-01 09:14:56'),('KR000007','Dubu Jorim','Dubu-jorim (두부조림) is a popular Korean side dish featuring pan-fried or deep-fried tofu simmered in a savory, spicy, and often slightly sweet sauce. It\'s a comforting banchan (side dish) often served with rice.','','4e031a40-0757-425a-ab03-bb0ddc3c99ab.jpg','KR','R','KR','N','N','A','2025-07-01 09:15:52','N',0,0,12.99,'N',0.00,'2025-07-01 09:15:52','',0.0,0,'yzh','yzh','2025-07-01 09:15:52','2025-07-01 09:15:52'),('KR000008','Origogi','The flavor tends to be less intensely saucy than some Chinese roasted ducks, focusing more on the natural taste of the duck meat enhanced by subtle Korean seasonings, and a focus on freshness and balance with the accompanying vegetables and wraps.','','0c7d4630-668b-4701-9435-0113f137624d.jpg','KR','R','KR','N','N','A','2025-07-01 09:17:28','N',0,0,15.99,'N',0.00,'2025-07-01 09:17:28','',0.0,0,'yzh','yzh','2025-07-01 09:17:28','2025-07-01 09:17:28'),('MM000001','Nasi Lemak','Served with egg, cucumber, sambal, peanuts and rice','','ed5afcc9-bd30-4ca6-9c74-93f5a4f13db8.jpg','MM','R','LC','N','N','A','2025-06-29 15:10:46','N',0,0,5.99,'Y',0.10,'2025-06-23 14:52:56','',4.0,1,'yzh','yzh','2025-06-23 14:52:56','2025-07-04 14:59:26'),('MM000002','Lemon Tea','Served with ice and tea','','c6fd2e3e-706a-4b3f-988d-1f649903cf58.jpg','MM','BR','JP','N','N','A','2025-06-26 07:43:54','N',0,0,2.90,'N',0.00,'2025-06-25 07:41:52','',4.8,4,'yzh','yzh','2025-06-25 07:41:52','2025-07-04 14:59:26'),('MM000003','Nasi Lemak + Ayam Goreng','Serve with sambal, ayam goreng, cucuember, nasi lemak biasa','','71a1b79d-f8b7-4853-8ebf-4630dcf4bb14.jpg','MM','R','LC','N','N','A','2025-07-01 08:59:42','N',0,0,10.90,'N',0.00,'2025-07-01 08:59:42','',0.0,0,'yzh','yzh','2025-07-01 08:59:42','2025-07-01 08:59:42'),('MM000004','Satay','Satay with peanut sauce, cucumber','','834a1d24-5c67-46f2-b251-5fa0f6bfe01a.jpg','MM','R','LC','N','N','A','2025-07-01 09:00:54','N',0,0,8.99,'N',0.00,'2025-07-01 09:00:54','',0.0,0,'yzh','yzh','2025-07-01 09:00:54','2025-07-01 09:00:54'),('MM000005','Cendol','Cendol is a traditional Southeast Asian dessert that is particularly popular in countries like Malaysia, Singapore, Indonesia, Thailand, and Myanmar. It\'s a refreshing, sweet, and cooling dish, especially beloved in hot climates.','','ca4db25c-8f37-4abf-a49a-8122d0ab9e69.jpg','MM','BR','LC','N','N','A','2025-07-01 09:02:11','N',0,0,5.99,'N',0.00,'2025-07-01 09:02:11','',0.0,0,'yzh','yzh','2025-07-01 09:02:11','2025-07-01 09:02:11'),('MM000006','Laksa','Laksa is a popular spicy noodle soup from Southeast Asian cuisine. It\'s particularly iconic in Malaysia, Singapore, and Indonesia, with many regional variations that boast distinct flavors and ingredients.','','3f570b43-3600-4db4-8c08-044a1a8aa841.jpg','MM','N','LC','N','N','A','2025-07-01 09:03:18','N',0,0,6.99,'N',0.00,'2025-07-01 09:03:18','',0.0,0,'yzh','yzh','2025-07-01 09:03:18','2025-07-01 09:03:18'),('MM000007','Ayam Kut Teh','Chi Kut teh is a comforting chicken  rib soup dish. though no tea is actually in the soup itself; rather, it refers to the strong Chinese tea often served alongside it, believed to aid digestion after the rich meal.','','83816022-d19b-4ca8-9d6d-2e4c92198499.jpg','MM','R','LC','N','Y','A','2025-07-01 09:06:59','N',0,0,15.99,'N',0.00,'2025-07-01 09:06:59','',0.0,0,'yzh','yzh','2025-07-01 09:06:59','2025-07-01 09:06:59'),('PR000001','Chee Cheong Fun','a popular Cantonese/Malaysian dish of silky, steamed rice noodle rolls. In KL, it\'s often served with sweet, savory, and spicy sauces (like hoisin, chili, or prawn paste), sometimes with fried shallots, sesame seeds, or stuffed with meat/shrimp.','','f4b08183-11f1-43ab-be08-e0603cff0cde.jpg','PR','N','LC','N','N','A','2025-07-01 09:29:29','N',0,0,5.99,'N',0.00,'2025-07-01 09:29:29','',0.0,0,'yzh','yzh','2025-07-01 09:29:29','2025-07-01 09:29:29'),('PR000002','Penang Cendol','Penang Cendol is a celebrated Malaysian iced dessert, famous for its distinct Teochew influence. It features finely shaved ice, pandan-flavored green rice flour jellies, rich coconut milk, fragrant Gula Melaka (palm sugar), and often sweetened red beans.','','9899279e-df8c-4e57-9eb9-05d239b9e366.jpg','PR','BR','LC','N','N','A','2025-07-01 09:30:20','N',0,0,6.99,'N',0.00,'2025-07-01 09:30:20','',0.0,0,'yzh','yzh','2025-07-01 09:30:20','2025-07-01 09:30:20'),('PR000003','Penang Laksa',' a tangy, spicy, and sour Malaysian noodle soup. It features a rich fish-based broth (often mackerel) simmered with tamarind (asam), ginger torch flower, and Vietnamese mint, served with thick rice noodles and fresh vegetables.','','a7da7602-2227-40e8-9252-933218063333.jpg','PR','N','LC','N','N','A','2025-07-01 09:31:04','N',0,0,7.99,'N',0.00,'2025-07-01 09:31:04','',0.0,0,'yzh','yzh','2025-07-01 09:31:04','2025-07-01 09:31:04'),('PR000004','Rojak',' fruit and vegetable salad, meaning \"mixture.\" It features a medley of fresh or deep-fried ingredients like fruits, tofu, cucumber, and fritters, tossed in a sticky, sweet, spicy, and tangy dressing often made with prawn paste or peanut sauce.','','099920ae-584f-477e-ad97-f1aec0419aca.jpg','PR','T','LC','N','N','A','2025-07-01 09:31:59','N',0,0,5.50,'N',0.00,'2025-07-01 09:31:59','',0.0,0,'yzh','yzh','2025-07-01 09:31:59','2025-07-01 09:31:59'),('PR000005','Penang White Curry','known for its light, savory, and spicy coconut-based broth. Unlike red curries, its \"white\" broth is infused with a hidden, potent chili paste on the side for customizable heat, topped with noodles, seafood, tofu puffs, and bean sprouts.','','acf21608-e884-48f3-93d3-1f32b4854d2d.jpg','PR','N','LC','N','N','A','2025-07-01 09:32:53','N',0,0,8.99,'N',0.00,'2025-07-01 09:32:53','',0.0,0,'yzh','yzh','2025-07-01 09:32:53','2025-07-01 09:32:53'),('PR000006','Char kuey teow','Char Kuey Teow is a renowned Malaysian stir-fried noodle dish. Flat rice noodles are wok-fried over high heat with dark and light soy sauce, chili, prawns, cockles, Chinese sausage, egg, beansprouts, and chives, creating a smoky \"wok hei\" aroma.','','04480172-3bb5-48ad-b681-68526365a660.jpg','PR','N','LC','N','N','A','2025-07-01 09:35:12','N',0,0,9.99,'N',0.00,'2025-07-01 09:35:12','',0.0,0,'yzh','yzh','2025-07-01 09:35:12','2025-07-01 09:35:12'),('PR000007','Hokkien Mee','Prawn Mee** – a fiery, rich noodle soup with a robust prawn and pork bone broth (red/soupy).','','ce719162-eb22-4937-a2d2-2e52bba073fb.jpg','PR','N','LC','N','N','A','2025-07-01 09:36:12','N',0,0,11.99,'N',0.00,'2025-07-01 09:36:12','',0.0,0,'yzh','yzh','2025-07-01 09:36:12','2025-07-01 09:36:12');
